INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.84, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 22, 4, 0, 120701, 450, "2025/01/15 15:00:00", 0, 120701, 283, 120701, "しぇふぃ", 0, 3, 1, "2025/01/20 11:59:59", 1, "シェフィ（ニューイヤー）", 1, 0, 120701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.3, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 22, 4, 0, 120801, 450, "2023/10/16 15:00:00", 0, 120801, 193, 120801, "るか", 0, 1, 2, "2030/12/31 15:00:00", 1, "ルカ（ニューイヤー）", 1, 0, 120801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.425, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 38, 3, 0, 120901, 450, "2025/01/15 15:00:00", 0, 120901, 424, 120901, "いりや", 0, 3, 12, "2025/01/20 11:59:59", 1, "イリヤ（ニューイヤー）", 2, 0, 120901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.25, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 41, 5, 0, 121001, 450, "2025/02/20 12:00:00", 0, 121001, 164, 121001, "ぺこりーぬ", 0, 3, 1, "2025/02/24 11:59:59", 1, "ペコリーヌ（オーバーロード）", 1, 0, 121001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.07, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 42, 7, 0, 121101, 450, "2025/02/20 12:00:00", 0, 121101, 588, 121101, "きゃる", 0, 3, 1, "2025/02/24 11:59:59", 1, "キャル（オーバーロード）", 2, 0, 121101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.55, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 40, 4, 0, 121201, 450, "2023/11/16 15:00:00", 0, 121201, 260, 121201, "らびりすた", 0, 1, 6, "2030/12/31 15:00:00", 1, "ラビリスタ（オーバーロード）", 1, 0, 121201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.9, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 3, 3, 0, 121301, 450, "2022/03/03 19:00:00", 0, 121301, 731, 121301, "くるみ", 0, 3, 3, "2030/12/31 15:00:00", 0, "クルミ（ステージ）", 1, 0, 121301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.27, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 7, 7, 0, 121401, 450, "2022/03/15 15:00:00", 0, 121401, 742, 121401, "みさき", 0, 3, 15, "2030/12/31 15:00:00", 0, "ミサキ（ステージ）", 2, 0, 121401, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.0, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 6, 6, 0, 121501, 450, "2025/04/26 12:00:00", 0, 121501, 590, 121501, "あゆみ", 0, 3, 12, "2025/04/30 11:59:59", 1, "アユミ（怪盗）", 1, 0, 121501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.425, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 3, 3, 0, 121601, 450, "2022/04/15 15:00:00", 0, 121601, 292, 121601, "いのり", 0, 3, 17, "2030/12/31 15:00:00", 0, "イノリ（怪盗）", 1, 0, 121601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 180901, 0.0, "", 0, 0, 0, 121701, 0, "2015/04/01 15:00:00", 0, 0, 421, 121701, "あきの", 0, 3, 0, "2030/12/31 15:00:00", 1, "アキノ（アキノ＆サレン）", 0, 0, 0, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 180901, 0.0, "", 0, 0, 0, 121801, 0, "2015/04/01 15:00:00", 0, 0, 421, 121801, "されん", 0, 3, 0, "2030/12/31 15:00:00", 1, "サレン（アキノ＆サレン）", 0, 0, 0, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.125, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 5, 5, 0, 121901, 450, "2022/05/15 15:00:00", 0, 121901, 293, 121901, "あんな", 0, 3, 12, "2030/12/31 15:00:00", 0, "アンナ（パイレーツ）", 2, 0, 121901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.425, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 3, 3, 0, 122001, 450, "2022/05/03 19:00:00", 0, 122001, 380, 122001, "しのぶ", 0, 3, 14, "2030/12/31 15:00:00", 0, "シノブ（パイレーツ）", 1, 0, 122001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.97, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 35, 35, 0, 122101, 450, "2024/04/18 15:00:00", 0, 122101, 731, 122101, "あおい", 0, 1, 9, "2030/12/31 15:00:00", 1, "アオイ（キャンプ）", 1, 0, 122101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.84, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 4, 4, 0, 122201, 450, "2022/05/31 12:00:00", 0, 122201, 419, 122201, "ゆかり", 0, 3, 8, "2030/12/31 15:00:00", 0, "ユカリ（キャンプ）", 1, 0, 122201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.425, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 43, 43, 0, 122301, 450, "2022/06/15 15:00:00", 0, 122301, 564, 122301, "うぁんぴぃ", 0, 3, 0, "2030/12/31 15:00:00", 0, "ヴァンピィ", 2, 0, 122301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.42, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 1, 1, 0, 122401, 450, "2024/06/17 15:00:00", 0, 122401, 264, 122401, "ひより", 0, 1, 8, "2030/12/31 15:00:00", 1, "ヒヨリ（サマー）", 1, 0, 122401, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 4, 4, 0, 122501, 450, "2025/08/22 12:00:00", 0, 122501, 250, 122501, "れい", 0, 3, 0, "2025/08/31 11:59:59", 1, "レイ（サマー）", 1, 0, 122501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.27, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 7, 7, 0, 122601, 450, "2022/07/15 15:00:00", 0, 122601, 554, 122601, "ゆい", 0, 3, 0, "2030/12/31 15:00:00", 0, "ユイ（サマー）", 2, 0, 122601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.92, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 7, 7, 0, 122701, 450, "2022/08/15 15:00:00", 0, 122701, 812, 122701, "きょうか", 0, 3, 0, "2030/12/31 15:00:00", 0, "キョウカ（サマー）", 2, 0, 122701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.295, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 1, 1, 0, 122801, 450, "2024/07/16 15:00:00", 0, 122801, 237, 122801, "みそぎ", 0, 1, 0, "2030/12/31 15:00:00", 1, "ミソギ（サマー）", 1, 0, 122801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.25, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 5, 5, 0, 122901, 450, "2025/08/22 12:00:00", 0, 122901, 361, 122901, "みみ", 0, 3, 0, "2025/08/31 11:59:59", 1, "ミミ（サマー）", 1, 0, 122901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.27, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 44, 44, 0, 123001, 450, "2025/06/27 12:00:00", 0, 123001, 746, 123001, "あめす", 0, 3, 0, "2025/06/30 11:59:59", 1, "アメス", 2, 0, 123001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.795, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 7, 7, 0, 123101, 450, "2022/09/03 19:00:00", 0, 123101, 793, 123101, "まほ", 0, 3, 0, "2030/12/31 15:00:00", 0, "マホ（エクスプローラー）", 2, 0, 123101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.425, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 3, 3, 0, 123201, 450, "2022/09/15 15:00:00", 0, 123201, 256, 123201, "あやね", 0, 3, 0, "2030/12/31 15:00:00", 0, "アヤネ（エクスプローラー）", 1, 0, 123201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.62, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 0, 1, 0, 123301, 450, "2025/09/16 15:00:00", 0, 123301, 350, 123301, "ねあ", 0, 3, 0, "2025/09/30 11:59:59", 1, "ネア", 1, 0, 123301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0.0, "", 5, 5, 0, 123401, 0, "2015/04/01 15:00:00", 0, 0, 0, 123401, "じゅん", 0, 3, 0, "2030/12/31 15:00:00", 0, "ジュン（キャンプ）", 0, 0, 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.34, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 6, 6, 0, 123501, 450, "2024/09/17 15:00:00", 0, 123501, 583, 123501, "りん", 0, 1, 0, "2030/12/31 15:00:00", 1, "リン（ハロウィン）", 1, 0, 123501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 4, 4, 0, 123601, 450, "2024/10/24 12:00:00", 0, 123601, 262, 123601, "とも", 0, 3, 0, "2024/10/28 11:59:59", 1, "トモ（ハロウィン）", 1, 0, 123601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.07, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 21, 7, 0, 123701, 450, "2022/10/15 15:00:00", 0, 123701, 741, 123701, "ななか", 0, 3, 0, "2030/12/31 15:00:00", 0, "ナナカ（ハロウィン）", 2, 0, 123701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.295, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 1, 1, 0, 123801, 450, "2024/11/26 12:00:00", 0, 123801, 238, 123801, "くりすてぃーな", 0, 3, 0, "2024/11/30 11:59:59", 1, "クリスティーナ（ワイルド）", 1, 0, 123801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.125, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 2, 2, 0, 123901, 450, "2022/11/15 15:00:00", 0, 123901, 183, 123901, "まつり", 0, 3, 0, "2030/12/31 15:00:00", 0, "マツリ（ワイルド）", 1, 0, 123901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.07, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 7, 7, 0, 124001, 450, "2024/12/22 12:00:00", 0, 124001, 438, 124001, "あかり", 0, 3, 0, "2024/12/31 11:59:59", 1, "アカリ（クリスマス）", 2, 0, 124001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 6, 6, 0, 124101, 450, "2024/11/16 15:00:00", 0, 124101, 433, 124101, "より", 0, 1, 0, "2030/12/31 15:00:00", 1, "ヨリ（クリスマス）", 2, 0, 124101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.07, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 5, 5, 0, 124201, 450, "2022/12/23 12:00:00", 0, 124201, 144, 124201, "じゅん", 0, 3, 0, "2030/12/31 15:00:00", 0, "ジュン（クリスマス）", 1, 0, 124201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 181001, 0.0, "", 0, 0, 0, 124301, 0, "2015/04/01 15:00:00", 0, 0, 577, 124301, "あん", 0, 3, 0, "2030/12/31 15:00:00", 1, "アン（アン＆グレア）", 0, 0, 0, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 181001, 0.0, "", 0, 0, 0, 124401, 0, "2015/04/01 15:00:00", 0, 0, 577, 124401, "ぐれあ", 0, 3, 0, "2030/12/31 15:00:00", 1, "グレア（アン＆グレア）", 0, 0, 0, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.07, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 21, 7, 0, 124501, 450, "2025/01/15 15:00:00", 0, 124501, 707, 124501, "ほまれ", 0, 3, 0, "2025/01/20 11:59:59", 1, "ホマレ（ニューイヤー）", 2, 0, 124501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.44, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 21, 7, 0, 124601, 450, "2025/01/15 15:00:00", 0, 124601, 698, 124601, "みさと", 0, 3, 0, "2025/01/20 11:59:59", 1, "ミサト（ニューイヤー）", 2, 0, 124601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.24, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 46, 7, 0, 124701, 450, "2024/12/16 15:00:00", 0, 124701, 590, 124701, "みつき", 0, 1, 0, "2030/12/31 15:00:00", 1, "ミツキ（ニューイヤー）", 1, 0, 124701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.14, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 0, 4, 0, 124801, 450, "2025/02/20 12:00:00", 0, 124801, 423, 124801, "のぞみ", 0, 3, 0, "2025/02/24 11:59:59", 1, "ノゾミ（リベレイター）", 1, 0, 124801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 0, 1, 0, 124901, 450, "2025/01/16 15:00:00", 0, 124901, 170, 124901, "かや", 0, 1, 0, "2030/12/31 15:00:00", 1, "カヤ（リベレイター）", 1, 0, 124901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 0, 5, 0, 125001, 450, "2025/02/20 12:00:00", 0, 125001, 221, 125001, "むいみ", 0, 3, 0, "2025/02/24 11:59:59", 1, "ムイミ（リベレイター）", 1, 0, 125001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.24, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 47, 8, 0, 125101, 450, "2023/03/03 19:00:00", 0, 125101, 825, 125101, "たまき", 0, 3, 0, "2030/12/31 15:00:00", 0, "タマキ（カフェ）", 1, 0, 125101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 4, 4, 0, 125201, 450, "2023/03/10 12:00:00", 0, 125201, 463, 125201, "もにか", 0, 3, 0, "2030/12/31 15:00:00", 0, "モニカ（カフェ）", 1, 0, 125201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.07, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 6, 6, 0, 125301, 450, "2025/04/26 12:00:00", 0, 125301, 752, 125301, "こっころ", 0, 3, 0, "2025/04/30 11:59:59", 1, "コッコロ（レンジャー）", 1, 0, 125301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 8, 8, 0, 125401, 450, "2023/04/10 12:00:00", 0, 125401, 710, 125401, "しおり", 0, 3, 0, "2030/12/31 15:00:00", 0, "シオリ（レンジャー）", 1, 0, 125401, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.92, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 50, 7, 0, 125501, 450, "2025/05/15 15:00:00", 0, 125501, 443, 125501, "じーた", 0, 3, 0, "2025/05/31 11:59:59", 1, "ジータ（ウォーロック）", 2, 0, 125501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 0, 51, 0, 125601, 450, "2025/05/15 15:00:00", 0, 125601, 267, 125601, "びから", 0, 3, 0, "2025/05/31 11:59:59", 1, "ビカラ", 1, 0, 125601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.24, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 9, 7, 0, 125701, 450, "2025/04/16 15:00:00", 0, 125701, 579, 125701, "かりん", 0, 1, 0, "2030/12/31 15:00:00", 1, "カリン（アルケミスト）", 2, 0, 125701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, 3, 0, 125801, 450, "2023/04/17 12:00:00", 0, 125801, 464, 125801, "りり", 0, 3, 0, "2030/12/31 15:00:00", 0, "リリ（フォールン）", 1, 0, 125801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0.0, "", 1, 1, 0, 125901, 0, "2015/04/01 15:00:00", 0, 0, 0, 125901, "かや", 0, 3, 0, "2030/12/31 15:00:00", 1, "カヤ（リベレイター）", 0, 0, 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 0, 0, 126001, 450, "2023/10/31 12:00:00", 0, 126001, 406, 126001, "くりあ", 0, 3, 0, "2030/12/31 15:00:00", 0, "クリア（フォールン）", 1, 0, 126001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 53, 44, 0, 126101, 450, "2023/11/15 15:00:00", 0, 126101, 480, 126101, "ぷれしあ", 0, 3, 0, "2030/12/31 15:00:00", 0, "プレシア（フォールン）", 2, 0, 126101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 3, 3, 0, 126201, 450, "2025/06/10 12:00:00", 0, 126201, 568, 126201, "いりや", 0, 3, 0, "2025/06/20 11:59:59", 1, "イリヤ（儀装束）", 2, 0, 126201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.07, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 9, 7, 0, 126301, 450, "2023/06/15 15:00:00", 0, 126301, 456, 126301, "ゆき", 0, 3, 0, "2030/12/31 15:00:00", 0, "ユキ（儀装束）", 2, 0, 126301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 1, 1, 0, 126401, 450, "2025/08/31 12:00:00", 0, 126401, 373, 126401, "くろーちぇ", 0, 3, 0, "2025/09/16 14:59:59", 1, "クローチェ", 1, 0, 126401, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 0, 7, 0, 126501, 450, "2025/08/31 12:00:00", 0, 126501, 740, 126501, "らいらえる", 0, 3, 0, "2025/09/16 14:59:59", 1, "ライラエル", 2, 0, 126501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.04, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 7, 7, 0, 126601, 450, "2025/08/10 12:00:00", 0, 126601, 650, 126601, "ねねか", 0, 3, 0, "2025/08/15 14:59:59", 1, "ネネカ（サマー）", 2, 0, 126601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 5, 5, 0, 126701, 450, "2025/06/17 15:00:00", 0, 126701, 224, 126701, "あきの", 0, 1, 0, "2030/12/31 15:00:00", 1, "アキノ（サマー）", 1, 0, 126701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.97, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 5, 5, 0, 126801, 450, "2023/07/15 15:00:00", 0, 126801, 159, 126801, "ゆかり", 0, 3, 0, "2030/12/31 15:00:00", 0, "ユカリ（サマー）", 1, 0, 126801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 21, 7, 0, 126901, 450, "2025/08/22 12:00:00", 0, 126901, 682, 126901, "らんふぁ", 0, 3, 0, "2025/08/31 11:59:59", 1, "ランファ（サマー）", 2, 0, 126901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.97, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 52, 2, 0, 127001, 450, "2025/07/16 15:00:00", 0, 127001, 133, 127001, "くうか", 0, 1, 0, "2030/12/31 15:00:00", 1, "クウカ（サマー）", 1, 0, 127001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 46, 5, 0, 127101, 450, "2025/08/22 12:00:00", 0, 127101, 255, 127101, "しのぶ", 0, 3, 0, "2025/08/31 11:59:59", 1, "シノブ（サマー）", 1, 0, 127101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 7, 7, 0, 127201, 450, "2025/09/16 15:00:00", 0, 127201, 804, 127201, "きゃる", 0, 3, 0, "2025/09/30 11:59:59", 1, "キャル（編入生）", 2, 0, 127201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 8, 8, 0, 127301, 450, "2023/09/15 15:00:00", 0, 127301, 750, 127301, "すずな", 0, 3, 0, "2030/12/31 15:00:00", 0, "スズナ（編入生）", 1, 0, 127301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0.0, "", 1, 1, 0, 127401, 0, "2015/04/01 15:00:00", 0, 0, 0, 127401, "びから", 0, 3, 0, "2030/12/31 15:00:00", 1, "ビカラ（コラボ）", 0, 0, 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 4, 4, 0, 127501, 450, "2024/11/11 12:00:00", 0, 127501, 304, 127501, "されん", 0, 3, 0, "2024/11/18 11:59:59", 1, "サレン（サラサリア）", 1, 0, 127501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 4, 4, 0, 127601, 450, "2023/10/15 15:00:00", 0, 127601, 157, 127601, "るか", 0, 3, 0, "2030/12/31 15:00:00", 0, "ルカ（サラサリア）", 1, 0, 127601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 48, 6, 0, 127701, 450, "2024/10/10 12:00:00", 0, 127701, 693, 127701, "りんど", 0, 3, 0, "2030/12/31 15:00:00", 0, "リンド", 2, 0, 127701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 47, 7, 0, 127801, 450, "2024/10/18 12:00:00", 0, 127801, 706, 127801, "うるむ", 0, 3, 0, "2030/12/31 15:00:00", 0, "ヴルム", 2, 0, 127801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 5, 5, 0, 127901, 450, "2024/12/09 12:00:00", 0, 127901, 372, 127901, "ぺこりーぬ", 0, 3, 0, "2024/12/15 14:59:59", 1, "ペコリーヌ（クリスマス）", 2, 0, 127901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 35, 35, 0, 128001, 450, "2023/12/15 15:00:00", 0, 128001, 723, 128001, "くれじった", 0, 3, 0, "2030/12/31 15:00:00", 0, "クレジッタ（クリスマス）", 1, 0, 128001, 0);
