INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 38, 3, 0, 128301, 450, "2023/12/31 12:00:00", 0, 128301, 191, 128301, "いのり", 0, 1, 0, "2030/12/31 15:00:00", 1, "イノリ（ニューイヤー）", 1, 0, 128301, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 21, 7, 0, 128401, 450, "2025/01/09 12:00:00", 0, 128401, 801, 128401, "はつね", 0, 3, 0, "2025/01/15 14:59:59", 1, "ハツネ（ニューイヤー）", 2, 0, 128401, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 21, 7, 0, 128501, 450, "2025/01/09 12:00:00", 0, 128501, 739, 128501, "かすみ", 0, 3, 0, "2025/01/15 14:59:59", 1, "カスミ（ニューイヤー）", 2, 0, 128501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0.0, "", 1, 1, 0, 128601, 0, "2015/04/01 15:00:00", 0, 0, 0, 128601, "りり", 0, 3, 0, "2030/12/31 15:00:00", 1, "リリ（フォールン）", 0, 0, 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 0, 1, 0, 128701, 450, "2025/02/10 12:00:00", 0, 128701, 226, 128701, "ひより", 0, 3, 0, "2025/02/15 14:59:59", 1, "ヒヨリ（アストラル）", 1, 0, 128701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.965, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 0, 4, 0, 128801, 450, "2025/08/16 15:00:00", 0, 128801, 194, 128801, "れい", 0, 1, 0, "2030/12/31 15:00:00", 1, "レイ（アストラル）", 1, 0, 128801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 0, 7, 0, 128901, 450, "2025/02/10 12:00:00", 0, 128901, 772, 128901, "ゆい", 0, 3, 0, "2025/02/15 14:59:59", 1, "ユイ（アストラル）", 2, 0, 128901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 0, 7, 0, 129001, 450, "2025/08/31 12:00:00", 0, 129001, 800, 129001, "えりす", 0, 3, 0, "2025/09/16 14:59:59", 1, "エリス", 2, 0, 129001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 7, 7, 0, 129301, 450, "2025/03/10 12:00:00", 0, 129301, 708, 129301, "ゆに", 0, 3, 0, "2025/03/15 14:59:59", 1, "ユニ（ウィンター）", 1, 0, 129301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 2, 2, 0, 129401, 450, "2024/03/18 12:00:00", 0, 129401, 188, 129401, "くろえ", 0, 3, 0, "2030/12/31 15:00:00", 0, "クロエ（ウィンター）", 1, 0, 129401, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 1, 1, 0, 129501, 450, "2025/06/20 12:00:00", 0, 129501, 247, 129501, "ちえる", 0, 3, 0, "2025/06/27 11:59:59", 1, "チエル（ウィンター）", 1, 0, 129501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 0, 0, 129601, 450, "2025/08/31 12:00:00", 0, 129601, 550, 129601, "あねもね", 0, 3, 0, "2025/09/16 14:59:59", 1, "アネモネ", 1, 0, 129601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 0, 0, 129701, 450, "2025/08/31 12:00:00", 0, 129701, 540, 129701, "ねふぃーねら", 0, 3, 0, "2025/09/16 14:59:59", 1, "ネフィ＝ネラ", 1, 0, 129701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 5, 5, 0, 129801, 450, "2025/04/26 12:00:00", 0, 129801, 269, 129801, "まこと", 0, 3, 0, "2025/04/30 11:59:59", 1, "マコト（コマンダー）", 1, 0, 129801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.84, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 48, 6, 0, 129901, 450, "2024/04/15 15:00:00", 0, 129901, 294, 129901, "えりこ", 0, 3, 0, "2030/12/31 15:00:00", 0, "エリコ（コマンダー）", 1, 0, 129901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 0, 4, 0, 130001, 450, "2025/05/03 19:00:00", 0, 130001, 150, 130001, "やまと", 0, 3, 0, "2025/05/15 14:59:59", 1, "ヤマト", 1, 0, 130001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 9, 7, 0, 130101, 450, "2025/05/03 19:00:00", 0, 130101, 535, 130101, "わかな", 0, 3, 0, "2025/05/15 14:59:59", 1, "ワカナ", 1, 0, 130101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.84, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 0, 5, 0, 130201, 450, "2025/05/03 19:00:00", 0, 130201, 371, 130201, "ふぶき", 0, 3, 0, "2025/05/15 14:59:59", 1, "フブキ", 1, 0, 130201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0.0, "", 1, 4, 0, 130601, 0, "2015/04/01 15:00:00", 0, 0, 0, 130601, "れい", 0, 3, 0, "2030/12/31 15:00:00", 1, "レイ（アストラル）", 0, 0, 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.92, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 7, 7, 0, 130701, 450, "2025/05/03 19:00:00", 0, 130701, 563, 130701, "きょうか", 0, 3, 0, "2025/05/15 14:59:59", 1, "キョウカ（スプリング）", 2, 0, 130701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.84, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 7, 7, 0, 130801, 450, "2024/05/15 15:00:00", 0, 130801, 558, 130801, "すずめ", 0, 3, 0, "2030/12/31 15:00:00", 0, "スズメ（スプリング）", 2, 0, 130801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 7, 7, 0, 130901, 450, "2024/06/15 15:00:00", 0, 130901, 440, 130901, "くるる", 0, 3, 0, "2030/12/31 15:00:00", 0, "クルル", 2, 0, 130901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.84, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 7, 7, 0, 131001, 450, "2025/06/10 12:00:00", 0, 131001, 702, 131001, "まほ", 0, 3, 0, "2025/06/20 11:59:59", 1, "マホ（ドリームパーク）", 2, 0, 131001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 52, 2, 0, 131101, 450, "2024/06/30 12:00:00", 0, 131101, 165, 131101, "ねあ", 0, 3, 0, "2030/12/31 15:00:00", 0, "ネア（サマー）", 1, 0, 131101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 54, 54, 0, 131201, 450, "2025/07/10 12:00:00", 0, 131201, 753, 131201, "みそら", 0, 3, 0, "2025/07/23 11:59:59", 1, "ミソラ（サマー）", 2, 0, 131201, 0);
