INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0.0, "", 1, 1, 0, 131501, 0, "2015/04/01 15:00:00", 0, 0, 0, 131501, "ぷれしあ", 0, 3, 0, "2030/12/31 15:00:00", 1, "プレシア", 0, 0, 0, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.92, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 4, 4, 0, 131601, 450, "2025/07/10 12:00:00", 0, 131601, 399, 131601, "りり", 0, 3, 0, "2025/07/23 11:59:59", 1, "リリ（サマー）", 1, 0, 131601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.92, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 53, 44, 0, 131701, 450, "2025/08/10 12:00:00", 0, 131701, 743, 131701, "あめす", 0, 3, 0, "2025/08/15 14:59:59", 1, "アメス（サマー）", 2, 0, 131701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 21, 7, 0, 131801, 450, "2024/08/15 15:00:00", 0, 131801, 709, 131801, "ほまれ", 0, 3, 0, "2030/12/31 15:00:00", 0, "ホマレ（サマー）", 2, 0, 131801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (1, 0, 2.09, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 23, 7, 0, 131901, 450, "2024/08/31 12:00:00", 0, 131901, 725, 131901, "えみりあ", 0, 1, 0, "2030/12/31 15:00:00", 1, "エミリア（サマー）", 2, 0, 131901, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (1, 0, 2.09, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 21, 7, 0, 132001, 450, "2024/09/13 12:00:00", 0, 132001, 775, 132001, "えきどな", 0, 3, 0, "2024/09/25 11:59:59", 1, "エキドナ（サマー）", 2, 0, 132001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (1, 0, 2.09, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 24, 13, 0, 132101, 450, "2024/08/31 12:00:00", 0, 132101, 146, 132101, "れむ", 0, 3, 0, "2024/09/13 11:59:59", 1, "レム（サマー）", 1, 0, 132101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.84, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 7, 7, 0, 132201, 450, "2025/05/03 19:00:00", 0, 132201, 721, 132201, "のぞみ", 0, 3, 0, "2025/05/15 14:59:59", 1, "ノゾミ（アルケミスト）", 2, 0, 132201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", 7, 7, 0, 132301, 450, "2025/05/03 19:00:00", 0, 132301, 754, 132301, "るいずまりー", 0, 3, 0, "2025/05/15 14:59:59", 1, "ルイズマリー", 2, 0, 132301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で、大きな体で無邪気に遊び回る天才剣士。\n戦いの中で【剣圧】を溜め、その後のスキルやＵＢで物防\n一定無視のダメージを連発し、才気煥発の活躍を見せる。", 0, 5, 0, 132401, 450, "2025/06/20 12:00:00", 0, 132401, 501, 132401, "いろは", 0, 3, 0, "2030/12/31 15:00:00", 0, "イロハ", 1, 0, 132401, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、小柄で大人対応な錬金堂の省エネ店主。\n強力な弱体効果を与えながら、デバフ付与のたび増加する\n【虚脱】が80溜まると本気を出し定時厳守で戦い抜く。", 23, 7, 0, 132501, 450, "2025/05/15 15:00:00", 0, 132501, 636, 132501, "その", 0, 3, 0, "2030/12/31 15:00:00", 0, "ソノ", 2, 0, 132501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 0, 7, 0, 132801, 450, "2025/06/10 12:00:00", 0, 132801, 750, 132801, "らいらえる", 0, 3, 0, "2025/06/20 11:59:59", 1, "ライラエル（クリスマス）", 2, 0, 132801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 46, 5, 0, 132901, 450, "2024/12/09 12:00:00", 0, 132901, 748, 132901, "いお", 0, 3, 0, "2030/12/31 15:00:00", 0, "イオ（クリスマス）", 2, 0, 132901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 0, 0, 0, 133001, 450, "2025/08/31 12:00:00", 0, 133001, 234, 133001, "ぐれいす", 0, 3, 0, "2025/09/16 14:59:59", 1, "グレイス", 1, 0, 133001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.75, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", 0, 0, 0, 133101, 450, "2025/08/31 12:00:00", 0, 133101, 154, 133101, "うぁいおれっと", 0, 3, 0, "2025/09/16 14:59:59", 1, "ヴァイオレット", 1, 0, 133101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 22, 4, 0, 133201, 450, "2024/12/31 12:00:00", 0, 133201, 296, 133201, "もにか", 0, 1, 0, "2030/12/31 15:00:00", 1, "モニカ（ニューイヤー）", 1, 0, 133201, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 22, 4, 0, 133501, 450, "2025/07/10 12:00:00", 0, 133501, 718, 133501, "されん", 0, 3, 0, "2025/07/23 11:59:59", 1, "サレン（ニューイヤー）", 2, 0, 133501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 0, 0, 0, 133601, 450, "2025/07/23 12:00:00", 0, 133601, 445, 133601, "めどぅーさ", 0, 3, 0, "2025/07/31 11:59:59", 1, "メドゥーサ", 1, 0, 133601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 0, 8, 0, 133701, 450, "2025/08/15 15:00:00", 0, 133701, 717, 133701, "らびりすた", 0, 3, 0, "2025/08/22 11:59:59", 1, "ラビリスタ（アルファ）", 2, 0, 133701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 0, 7, 0, 133801, 450, "2025/08/15 15:00:00", 0, 133801, 759, 133801, "ねねか", 0, 3, 0, "2025/08/22 11:59:59", 1, "ネネカ（アルファ）", 2, 0, 133801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 0, 6, 0, 133901, 450, "2025/08/15 15:00:00", 0, 133901, 228, 133901, "くりすてぃーな", 0, 3, 0, "2025/08/22 11:59:59", 1, "クリスティーナ（アルファ）", 1, 0, 133901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 0, 0, 0, 134001, 450, "2025/08/31 12:00:00", 0, 134001, 746, 134001, "ふぃお", 0, 3, 0, "2025/09/16 14:59:59", 1, "フィオ", 2, 0, 134001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0.0, "", 1, 5, 0, 134101, 0, "2015/04/01 15:00:00", 0, 0, 0, 134101, "ふぶき", 0, 3, 0, "2030/12/31 15:00:00", 1, "フブキ", 0, 0, 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0.0, "", 1, 7, 0, 134201, 0, "2015/04/01 15:00:00", 0, 0, 0, 134201, "らいらえる", 0, 3, 0, "2030/12/31 15:00:00", 1, "ライラエル（クリスマス）", 0, 0, 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", 0, 7, 0, 134301, 450, "2025/09/16 15:00:00", 0, 134301, 778, 134301, "らんふぁ", 0, 3, 0, "2025/09/30 11:59:59", 1, "ランファ（儀装束）", 2, 0, 134301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", 21, 7, 0, 134401, 450, "2025/03/15 15:00:00", 0, 134401, 773, 134401, "ちか", 0, 3, 0, "2030/12/31 15:00:00", 0, "チカ（儀装束）", 2, 0, 134401, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", 0, 0, 0, 134501, 450, "2025/04/08 12:00:00", 0, 134501, 719, 134501, "くろーちぇ", 0, 3, 0, "2025/04/15 14:59:59", 1, "クローチェ（エアリアル）", 2, 0, 134501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", 35, 35, 0, 134601, 450, "2025/03/31 12:00:00", 0, 134601, 526, 134601, "あおい", 0, 3, 0, "2025/04/08 11:59:59", 1, "アオイ（パイロット）", 1, 0, 134601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", 7, 7, 0, 134701, 450, "2025/04/15 15:00:00", 0, 134701, 490, 134701, "ほうおう", 0, 3, 0, "2025/04/26 11:59:59", 1, "ホウオウ", 1, 0, 134701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.84, "【物理】中衛から、新たな素材で紡ぐワイルドテーラー。\n最も物攻が高い他の味方へ重複速度アップやＴＰ・攻撃支\n援を仕立て、全体へのＨＰ回復と併せ攻守を両立させる。", 1, 1, 0, 134801, 450, "2025/05/31 12:00:00", 0, 134801, 485, 134801, "つむぎ", 0, 3, 0, "2025/06/10 11:59:59", 1, "ツムギ（ジオ・ゲヘナ）", 1, 0, 134801, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、おエレガントな高笑いを轟かすド令嬢。\nＵＢや敵からの攻撃で【お堪忍袋】が尽きると逆上し、強\n化されたスキルと行動パターンで華麗におリベンジする。", 0, 2, 0, 134901, 450, "2025/06/10 12:00:00", 0, 134901, 196, 134901, "かのん", 0, 3, 0, "2025/06/20 11:59:59", 1, "カノン", 1, 0, 134901, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛で、永く夢見た本物の夏に咲き綻ぶ黒薔薇。\n【いばらの冠】の呪縛は再臨により解き放たれ、調和状態\nや攻防支援、回復効果を施し、月下の浜辺に静かに佇む。", 21, 7, 0, 135001, 450, "2025/06/30 12:00:00", 0, 135001, 785, 135001, "えりす", 0, 3, 0, "2025/07/10 11:59:59", 1, "エリス（サマー）", 2, 0, 135001, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で盛夏の白波を華麗に乗りこなす氷竜少女。\n敵全体を挑発し、被弾で溜まる【ぐずぐず】をＵＢで発散\nすることで周囲に攻撃支援と天真爛漫な笑顔を振りまく。", 4, 4, 0, 135101, 450, "2025/07/10 12:00:00", 0, 135101, 143, 135101, "しぇふぃ", 0, 3, 0, "2025/07/23 11:59:59", 1, "シェフィ（サマー）", 1, 0, 135101, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】中衛で夏の食を満喫し、ぷかぷか漂う天然少女。\nＴＰ・攻撃支援やバリアは味方の数で効果量が変化し、物\n理と魔法攻撃力合算のダメージで夏の思い出を心に刻む。", 7, 7, 0, 135201, 450, "2025/07/23 12:00:00", 0, 135201, 548, 135201, "ぷれしあ", 0, 3, 0, "2025/07/31 11:59:59", 1, "プレシア（サマー）", 2, 0, 135201, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】中衛で友情の芽を育む、真夏の『普通』の少女。\n【プルメリアのお守り】で強力な一撃から先頭を守り、味\n方の数で効果量が変化するスキルを鮮やかに命中させる。", 54, 54, 0, 135301, 450, "2025/07/31 12:00:00", 0, 135301, 413, 135301, "くりあ", 0, 3, 0, "2025/08/10 11:59:59", 1, "クリア（サマー）", 1, 0, 135301, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】中衛で砂浜の木陰に微睡むアルラウネの妖魔人。\n行動速度アップや初回使用時に回復量が増加するＴＰ回復\nを起点に支援し、穏やかな木漏れ日と共にゆらゆら憩う。", 52, 2, 0, 135401, 450, "2025/08/10 12:00:00", 0, 135401, 553, 135401, "あねもね", 0, 3, 0, "2025/08/15 14:59:59", 1, "アネモネ（サマー）", 2, 0, 135401, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【物理】前衛で、世界を守り笑顔を咲かせる情熱の豪炎。\n前方の敵全てを対象とする連撃の強化通常攻撃や、天楼覇\n断剣から放たれる極大ダメージの一閃で未来を切り拓く。", 0, 1, 0, 135501, 450, "2025/08/31 12:00:00", 0, 135501, 213, 135501, "あいら", 0, 3, 0, "2025/09/08 11:59:59", 1, "アイラ", 1, 0, 135501, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0.4, "【物理】前衛から、風裂く刃で世界を護る孤高の剣豪。\n卓越した剣技で敵の攻撃を捌いて反撃し、初回ＵＢで生成\nする分身と共に疾風迅雷の攻めで、未来へと駆け抜ける。", 0, 4, 0, 135601, 450, "2025/09/08 12:00:00", 0, 135601, 198, 135601, "しなつ", 0, 3, 0, "2025/09/16 14:59:59", 1, "シナツ", 1, 0, 135601, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1.84, "【物理】前衛で、二人きりの月下の空旅にときめく黒猫。\n物防弱体の他、ダメージ100ヒット後には華麗なステップ\nの追撃とＴＰ回復量増加で、砂漠の夜空に花を咲かせる。", 0, 1, 0, 135701, 450, "2025/09/16 15:00:00", 0, 135701, 291, 135701, "ひより", 0, 3, 0, "2030/12/31 15:00:00", 0, "ヒヨリ（サラサリア）", 1, 0, 135701, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】後衛から、雪魄氷姿の三味を弾じる初心な雪女。\n多様なデバフ効果で敵を弱体化させ、最も魔防の低い敵の\n状態に応じて発生する追加効果で、冥府を真白に染める。", 0, 7, 0, 135801, 450, "2025/09/30 12:00:00", 0, 135801, 830, 135801, "ゆきの", 0, 3, 0, "2025/10/10 11:59:59", 1, "ユキノ", 2, 0, 135801, 0);
