INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.09, "【魔法】中衛で陽光の下、煌く水面を共に駆けるシノビ。\n【水遁の印】を自らの攻撃力へと変え、束縛フィールドと\n水遁の術で最も遠い敵とその周囲に速やかな天誅を下す。", 47, 8, 0, 137101, 450, "2025/08/15 15:00:00", 0, 137101, 566, 137101, "にのん", 0, 3, 0, "2030/12/31 15:00:00", 0, "ニノン（サマー）", 2, 0, 137101, 0);
