INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 2.22, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 6, 6, 0, 191301, 450, "2015/04/01 15:00:00", 0, 191301, 850, 191301, "かずまさ", 0, 1, 0, "2030/12/31 15:00:00", 1, "カズマサ", 1, 0, 191301, 0);
